const e=JSON.parse('{"key":"v-210c173d","path":"/notes/ai/Multiple-object-tracking_%20A-literature-review.html","title":"Multiple object tracking: A literature review","lang":"zh-CN","frontmatter":{"title":"Multiple object tracking: A literature review","date":"2023-11-03T00:00:00.000Z","category":["Machine Leaning"],"tag":["Machine Leaning","Multi-object Tracking"],"isOriginal":true,"description":"Abstract Multiple Object Tracking (MOT) has gained increasing attention due to its academic and commercial potential. Although different approaches have been proposed to tackle this problem, it still remains challenging due to factors like abrupt appearance changes and severe object occlusions. In this work, we contribute the first comprehensive and most recent review on this problem. We inspect the recent advances in various aspects and propose some interesting directions for future research. To the best of our knowledge, there has not been any extensive review on this topic in the community. We endeavor to provide a thorough review on the development of this problem in recent decades. The main contributions of this review are fourfold: 1) Key aspects in an MOT system, including formulation, categorization, key principles, evaluation of MOT are discussed; 2) Instead of enumerating individual works, we discuss existing approaches according to various aspects, in each of which methods are divided into different groups and each group is discussed in detail for the principles, advances and drawbacks; 3) We examine experiments of existing publications and summarize results on popular datasets to provide quantitative and comprehensive comparisons. By analyzing the results from different perspectives, we have verified some basic agreements in the field; and 4) We provide a discussion about issues of MOT research, as well as some interesting directions which will become potential research effort in the future.","head":[["meta",{"property":"og:url","content":"https://blog.moorlands.cn/notes/ai/Multiple-object-tracking_%20A-literature-review.html"}],["meta",{"property":"og:site_name","content":"荒地"}],["meta",{"property":"og:title","content":"Multiple object tracking: A literature review"}],["meta",{"property":"og:description","content":"Abstract Multiple Object Tracking (MOT) has gained increasing attention due to its academic and commercial potential. Although different approaches have been proposed to tackle this problem, it still remains challenging due to factors like abrupt appearance changes and severe object occlusions. In this work, we contribute the first comprehensive and most recent review on this problem. We inspect the recent advances in various aspects and propose some interesting directions for future research. To the best of our knowledge, there has not been any extensive review on this topic in the community. We endeavor to provide a thorough review on the development of this problem in recent decades. The main contributions of this review are fourfold: 1) Key aspects in an MOT system, including formulation, categorization, key principles, evaluation of MOT are discussed; 2) Instead of enumerating individual works, we discuss existing approaches according to various aspects, in each of which methods are divided into different groups and each group is discussed in detail for the principles, advances and drawbacks; 3) We examine experiments of existing publications and summarize results on popular datasets to provide quantitative and comprehensive comparisons. By analyzing the results from different perspectives, we have verified some basic agreements in the field; and 4) We provide a discussion about issues of MOT research, as well as some interesting directions which will become potential research effort in the future."}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-11-06T06:49:46.000Z"}],["meta",{"property":"article:author","content":"游日山"}],["meta",{"property":"article:tag","content":"Machine Leaning"}],["meta",{"property":"article:tag","content":"Multi-object Tracking"}],["meta",{"property":"article:published_time","content":"2023-11-03T00:00:00.000Z"}],["meta",{"property":"article:modified_time","content":"2023-11-06T06:49:46.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"Multiple object tracking: A literature review\\",\\"image\\":[\\"\\"],\\"datePublished\\":\\"2023-11-03T00:00:00.000Z\\",\\"dateModified\\":\\"2023-11-06T06:49:46.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"游日山\\",\\"url\\":\\"https://blog.moorlands.cn\\"}]}"]]},"headers":[{"level":2,"title":"Abstract","slug":"abstract","link":"#abstract","children":[]},{"level":2,"title":"Introduction","slug":"introduction","link":"#introduction","children":[{"level":3,"title":"Contributions","slug":"contributions","link":"#contributions","children":[]},{"level":3,"title":"Denotations","slug":"denotations","link":"#denotations","children":[]}]},{"level":2,"title":"MOT problem","slug":"mot-problem","link":"#mot-problem","children":[{"level":3,"title":"Problem formulation","slug":"problem-formulation","link":"#problem-formulation","children":[]},{"level":3,"title":"MOT categorization","slug":"mot-categorization","link":"#mot-categorization","children":[]}]},{"level":2,"title":"剩下部分","slug":"剩下部分","link":"#剩下部分","children":[]}],"git":{"createdTime":1699253386000,"updatedTime":1699253386000,"contributors":[{"name":"Sunhill666","email":"sunhilly@qq.com","commits":1}]},"readingTime":{"minutes":14.69,"words":4408},"filePathRelative":"notes/ai/Multiple-object-tracking: A-literature-review.md","localizedDate":"2023年11月3日","excerpt":"<h2> Abstract</h2>\\n<p>Multiple Object Tracking (MOT) has gained increasing attention due to its academic and commercial potential. Although different approaches have been proposed to tackle this problem, it still remains challenging due to factors like abrupt appearance changes and severe object occlusions. In this work, we contribute the first comprehensive and most recent review on this problem. We inspect the recent advances in various aspects and propose some interesting directions for future research. To the best of our knowledge, there has not been any extensive review on this topic in the community. We endeavor to provide a thorough review on the development of this problem in recent decades. The main contributions of this review are fourfold: 1) Key aspects in an MOT system, including formulation, categorization, key principles, evaluation of MOT are discussed; 2) Instead of enumerating individual works, we discuss existing approaches according to various aspects, in each of which methods are divided into different groups and each group is discussed in detail for the principles, advances and drawbacks; 3) We examine experiments of existing publications and summarize results on popular datasets to provide quantitative and comprehensive comparisons. By analyzing the results from different perspectives, we have verified some basic agreements in the field; and 4) We provide a discussion about issues of MOT research, as well as some interesting directions which will become potential research effort in the future.</p>","copyright":{"author":"Sunhill666","license":"MIT"},"autoDesc":true}');export{e as data};
